import React, { useState } from 'react';
import { motion } from 'framer-motion';
import studentsData from './students.json';

const StudentDashboard = () => {
  const [students, setStudents] = useState(studentsData);
  const [selectedStudent, setSelectedStudent] = useState(null);
  const [showForm, setShowForm] = useState(false);
  const [newStudent, setNewStudent] = useState({ name: '', age: '', grade: '', email: '' });

  const handleInputChange = (e) => {
    const { name, value } = e.target;
    setNewStudent({ ...newStudent, [name]: value });
  };

  const addStudent = () => {
    if (newStudent.name && newStudent.age && newStudent.grade && newStudent.email) {
      const newEntry = { ...newStudent, id: students.length + 1 };
      setStudents([...students, newEntry]);
      setShowForm(false);
      setNewStudent({ name: '', age: '', grade: '', email: '' });
    }
  };

  return (
    <div className="p-10 min-h-screen bg-gray-100">
      <div className="flex justify-between items-center mb-6">
        <h1 className="text-4xl font-bold text-gray-800">Student Dashboard</h1>
        <button onClick={() => setShowForm(!showForm)}>{showForm ? 'Cancel' : 'Add Student'}</button>
      </div>
      {showForm && (
        <div className="bg-white p-6 rounded-lg shadow-lg mb-6">
          <h2 className="text-2xl font-bold mb-4">Add New Student</h2>
          <div className="grid grid-cols-1 md:grid-cols-2 gap-4">
            <input name="name" value={newStudent.name} onChange={handleInputChange} placeholder="Name" />
            <input name="age" value={newStudent.age} onChange={handleInputChange} placeholder="Age" />
            <input name="grade" value={newStudent.grade} onChange={handleInputChange} placeholder="Grade" />
            <input name="email" value={newStudent.email} onChange={handleInputChange} placeholder="Email" />
          </div>
          <div className="mt-4">
            <button onClick={addStudent}>Save Profile</button>
          </div>
        </div>
      )}

      {selectedStudent ? (
        <motion.div initial={{ opacity: 0 }} animate={{ opacity: 1 }} className="max-w-xl mx-auto">
          <button onClick={() => setSelectedStudent(null)} className="mb-4">Back</button>
          <div className="bg-white p-6 rounded-lg shadow-md">
            <h2 className="text-3xl font-bold">{selectedStudent.name}</h2>
            <p>Age: {selectedStudent.age}</p>
            <p>Grade: {selectedStudent.grade}</p>
            <p>Email: {selectedStudent.email}</p>
          </div>
        </motion.div>
      ) : (
        <div style={{ display: 'grid', gridTemplateColumns: 'repeat(auto-fit, minmax(200px, 1fr))', gap: '20px' }}>
          {students.map((student) => (
            <motion.div
              key={student.id}
              whileHover={{ scale: 1.05 }}
              whileTap={{ scale: 0.95 }}
              onClick={() => setSelectedStudent(student)}
              style={{ padding: '20px', border: '1px solid #ccc', borderRadius: '10px', cursor: 'pointer' }}
            >
              <h3>{student.name}</h3>
              <p>Grade: {student.grade}</p>
            </motion.div>
          ))}
        </div>
      )}
    </div>
  );
};

export default StudentDashboard;
